import React, { Fragment } from "react";
import { Button, Grid, Paper, Typography, Link } from "@material-ui/core";
import TextField from "@material-ui/core/TextField";
import { makeStyles } from "@material-ui/core/styles";
import styles from "../styles/SignFormStyle";

const useStyles = makeStyles(styles);

// const useStyles = makeStyles(theme => ({
//   paper: {
//     padding: theme.spacing(4),
//   },
//   formHeader: {
//     marginBottom: theme.spacing(5),
//   },
//   form: {
//     margin: theme.spacing(3),
//   },
//   formText: {
//     margin: theme.spacing(2),
//   },
//   button: {
//     marginTop: theme.spacing(3),
//   },
// }));

function Login(props) {
  const classes = useStyles();

  return (
    <Grid container justify="center" alignItems="center" style={{ minHeight: "100vh" }}>
      <Grid item>
        <Paper maxWidth="xs" className={classes.paper}>
          <Grid
            container
            direction="column"
            justify="center"
            alignItems="center"
            spacing={1}
            className={classes.formHeader}
          >
            <Grid item>
              <Typography variant="h4">SIGN IN</Typography>
            </Grid>
            <Grid item>
              <Typography variant="body2">
                {"Not a member yet? "}
                <Link href="/signup" underline="always">
                  Sign up here
                </Link>
              </Typography>
            </Grid>
          </Grid>

          <form className={classes.form}>
            <TextField
              id="outlined-helperText"
              label="Email"
              helperText=""
              variant="outlined"
              margin="normal"
              size="large"
              fullWidth
            />

            <TextField
              id="outlined-helperText"
              label="Password"
              helperText=""
              variant="outlined"
              margin="normal"
              size="large"
              fullWidth
            />

            <Button variant="contained" color="primary" size="large" fullWidth className={classes.button}>
              Sign In
            </Button>
          </form>
          <Typography variant="body2" align="center">
            <Link href="/" underline="always">
              Forgot password?
            </Link>
          </Typography>
        </Paper>
      </Grid>
    </Grid>
  );
}

export default Login;
